  input: 'TEXT,"F3A","","This response is in regard to questions concerning the October
    Quarterly Report (7/1/02 - 9/30/02) for Herseth for Congress, FEC ID #  C00367631.  The
    procedures for requesting the identification of all individuals who contribute
    in excess of 200 dollars in an election cycle are as follows  1. Original solicitation
    includes the following  Federal law requires us to use our best efforts to collect
    and report the name, mailing address, occupation and name of employer of individuals
    whose contributions exceed 200 dollarrs in an election.  2. Follow for information
    that is not provided is done within 30 days of receipt and is requested by mail
    and includes the following:  Federal law requires us to use our best efforts to
    obtain, maintain, and submit the name, mailing address, occupation and name of
    employer for individuals whose contributions exceed 200 dollars per election.  To
    help us comply with this law, please fill out the information below and return
    it by faxing to (605) 725-2532 or sending it in the enclosed envelope to  Herseth
    for Congress, PO Box 85352, Sioux Falls, SD 57118-5352.  3. Received information
    is included in the next regularly scheduled report.  Finally, in regard to the
    apparent discrepancy between figures from Column A and B, please note the corrections
    on the attached amendment."'
